// pages/index/TestProcess/index.js
Page({

  /**
   * 页面的初始数据
   */
  data: {
    ScreenWidth: "",
    ScreenHeight: "",
    backgroundimage: "data:image/png;base64,"
  },

  /**
   * 生命周期函数--监听页面加载
   */
  onLoad: function(options) {
    var setWidth = wx.getSystemInfoSync().screenWidth;
    var setHeight = wx.getSystemInfoSync().screenHeight;
    this.setData({
      ScreenHeight: setHeight,
      ScreenWidth: setWidth
    })
    var pages = getCurrentPages();
    var prevPage = pages[pages.length - 2]; //上一个页面
    prevPage.setData({
      isRefresh: true
    })
  },

  /**
   * 生命周期函数--监听页面初次渲染完成
   */
  onReady: function() {

  },

  /**
   * 生命周期函数--监听页面显示
   */
  onShow: function() {

  },

  /**
   * 生命周期函数--监听页面隐藏
   */
  onHide: function() {

  },

  /**
   * 生命周期函数--监听页面卸载
   */
  onUnload: function() {

  },

  /**
   * 页面相关事件处理函数--监听用户下拉动作
   */
  onPullDownRefresh: function() {

  },

  /**
   * 页面上拉触底事件的处理函数
   */
  onReachBottom: function() {

  },

  /**
   * 用户点击右上角分享
   */
  onShareAppMessage: function() {

  }
})